PAINEL ELETRÔNICO 
Bancada de ensaios para o controle de nível, vasão, pressão e temperatura 1
Descrição Geral: equipamento destinado ao treinamento de automação industrial para máquinas e processos, utilizando conceitos de funcionamento de controladores lógicos programáveis e software de programação possibilitando aplicação de contato aberto, contato fechado, bobina, temporizador, contador, comparador, funções aritmética, controle analógico, inversor de frequência, controle ON-OFF, controle PWM, controle PID. Para maior segurança, o equipamento deve possuir painel e dispositivos que impossibilite o usuário ter acesso acidental a partes energizadas ou que apresentem riscos no processo. No caso de elementos que não possam ser enclausurados por motivos funcionais do equipamento os mesmos devem ser Identificados fisicamente no equipamento como área de risco. Os principais experimentos que devem ser atendidos são: Aplicar software de programação de CLP para automatizar sistema comandado por motor elétrico e por eletroválvula; Analisar sinais de sensores tipo chave boia, para identificação de nível de reservatório;

